using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace ZhoadaVRetazci
{
    class Program
    {
        static void Main(string[] args)
        {
            string str = "";
            char chMax=str[0], ch=str[0];
            int max=1, count=1;

            for (int i=0; i<str.Length-1; i++)
            {            
                if(ch == str[i+1])
                {
                    count++;
                }
                else
                {
                    if (count > max)
                    {
                        max = count;
                        count = 1;
                        chMax = ch;
                    }
                    ch = str[i + 1];
                    count = 1;
                }
            }

            Console.WriteLine("{0} -> {1}", chMax, max);
            Console.ReadKey();

        }
    }
}
